@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent {

  public eventos: any = [
    {
      Tema: 'Angular 11',
      Local: 'Belo Horizonte'
    },
    {
      Tema: 'DotNet 5.0',
      Local: 'São Paulo'
    },
    {
      Tema: 'SqlServer',
      Local: 'Rio de Janeiro'
    }
  ]
}
<h1>Eventos Component</h1>

<p><b>Tema:</b> {{eventos[0].Tema}}</p>
<p><b>Local:</b> {{eventos[0].Local}}</p>

